import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the cart element (div with class 'cart' and text 'Cart')
    await page.waitForSelector('div.cart', { timeout: 5000 });

    // Take a screenshot before opening cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_cart_visible.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_cart_visible.png'));

    // Click the cart element to open the cart modal
    // Use text and class selector for robustness
    const cartDiv = await page.$('xpath=//div[contains(@class,"cart") and contains(normalize-space(),"Cart")]');
    if (!cartDiv) throw new Error("Cart element not found");
    await cartDiv.click();

    // Wait for the cart modal to appear (it has id="cartModal" and style.display='block')
    await page.waitForSelector('#cartModal', { state: 'visible', timeout: 5000 });

    // Wait for cart modal content (cart-content or cartItems)
    await page.waitForSelector('#cartModal .cart-content, #cartItems', { timeout: 5000 });

    // Take screenshot of the opened cart modal
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_cart_modal_open.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_cart_modal_open.png'));

    // Extract cart modal visibility and header text for verification
    const cartModalVisible = await page.evaluate(() => {
      const modal = document.getElementById('cartModal');
      return modal && (modal.style.display === 'block' || getComputedStyle(modal).display === 'block');
    });

    const cartModalHeader = await page.evaluate(() => {
      const h2 = document.querySelector('#cartModal .cart-content h2');
      return h2 ? h2.textContent.trim() : null;
    });

    return {
      success: true,
      action: "Opened the Shopping Cart Modal and verified its visibility",
      extractedData: {
        cartModalVisible,
        cartModalHeader
      },
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}
